import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import './pages.css';

class Header extends Component {
  render() {
    return (
      <header className={styleMedia.headerStyle}>
        <h1 class= "titleStyle">Policyholder Blockchain Insurance</h1>
        <Link class= "linkStyle" to="/">Home</Link>
      </header>

    )
  }
}

export default Header;
